    </div>
    <div class="box">
        <div class="pattern" id="pattern">PHÂN TÍCH CẦU: ...</div>
        <div class="warning" id="warning"></div>
        <div class="result" id="result">DỰ ĐOÁN: ...</div>
    </div>

    <script>
        function predict() {
            const input = document.getElementById("inputData").value.trim().toLowerCase();
            const results = input.split(',').map(x => x.trim());
            if (results.length !== 10 || !results.every(x => x === "tài" || x === "xỉu")) {
                document.getElementById("result").innerHTML = "⚠️ Vui lòng nhập đúng 10 kết quả (Tài hoặc Xỉu)";
                return;
            }

            let tai = results.filter(r => r === "tài").length;
            let xiu = results.filter(r => r === "xỉu").length;

            let last = results.slice(-3).join(",");
            let warning = "";
            if (last === "tài,tài,tài" || last === "xỉu,xỉu,xỉu") {
                warning = "⚠️ CẢNH BÁO: SẮP GÃY CẦU!";
            }

            let pattern = "KHÔNG RÕ";
            if (results[8] === results[9] && results[6] !== results[7]) {
                pattern = "2-1 BẾT NHẸ";
            } else if (results.slice(7).every(x => x === results[7])) {
                pattern = "3 BỆT";
            }

            let prediction = tai > xiu ? "XỈU (91.8%)" : "TÀI (92.4%)";

            document.getElementById("pattern").innerHTML = "PHÂN TÍCH CẦU: " + pattern;
            document.getElementById("warning").innerHTML = warning;
            document.getElementById("result").innerHTML = "🎲 DỰ ĐOÁN: " + prediction;
        }
    </script>
</body>
</html>
